import React from "react";
import {Link} from "react-router-dom";

function CreatePage(){

    const customStyling = {
        width: '200px'
    }

    return(
        <div className='container'>
            <header>
                <div className=" d-flex justify-content-center">
                    <h1 className="text-center">Create Voucher</h1>
                </div>
            </header>
            <br/>
            <br/>
            <br/>

            <div className="container text-center align-items-center" >
                <form className='d-flex flex-column align-items-center'>
                    <div className='row' style={customStyling}>
                        {/*<div className="col-md-2 form-group mt-6">*/}
                            <label htmlFor="Pin" className="form-label">Pin</label>
                            <input type="text" maxLength={4} className="form-control col-md-2 text-center" id="Pin" />
                        {/*</div>*/}
                        {/*<div className="col-md-2 form-group">*/}
                            <label htmlFor="inputCity" className="form-label">Expiry Date</label>
                            <input type="date" className="form-control col-md-2 text-center " id="inputCity"/>
                        {/*</div>*/}
                        {/*<div className="col-md-2  form-group">*/}
                            <label htmlFor="inputZip" className="form-label">Redemptions</label>
                            <input type="number" min={1} className="form-control col-md-2 text-center" id="inputZip"/>
                        {/*</div>*/}
                    </div>
                    <br/>
                    <br/>

                    <div className="col-12">
                        <button type="submit" className="btn btn-outline-dark">Create Voucher</button>

                        <Link to={`/vadmin`}>
                            <button type="submit" className="btn btn-outline-dark offset-3">Back</button>
                        </Link>
                    </div>

                </form>
            </div>

        </div>

    )

}

export default CreatePage
